                <div class="contact-map-wrapper">
                <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d14602.700311876972!2d90.34510368647248!3d23.794582086878556!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3755c0e96fce29dd%3A0x6ccd9e51aba9e64d!2sMirpur-1%2C%20Dhaka!5e0!3m2!1sen!2sbd!4v1632417486404!5m2!1sen!2sbd"></iframe>
                </div>
                

            </div>
        </div>
    )
}

export default ContactMap
